Your provided bytecode is actually compiled from a Solidity code. There is no direct way to convert bytecode back to the original Solidity code as the compilation process is one-way and loses some information (like variable names, comments, etc.). However, reversing it can get you a rough equivalent of the original Solidity code. 

From the bytecode you provided, it appears to be a contract with four functions. Using a decompiler and understanding the EVM opcode, a rough pseudo Solidity code could look something like this:

```solidity
pragma solidity ^0.4.24;

contract MyContract {
    mapping(address => uint256) public balances;
    uint256 public totalSupply;

    event Transfer(address indexed _from, address indexed _to, uint256 _value);

    function MyContract(uint256 _initialSupply) public {
        balances[msg.sender] = totalSupply = _initialSupply;
    }

    function transfer(address _to, uint256 _value) public returns (bool success) {
        require(balances[msg.sender] >= _value);
        balances[msg.sender] -= _value;
        balances[_to] += _value;
        emit Transfer(msg.sender, _to, _value);
        return true;
    }

    function balanceOf(address _owner) public view returns (uint256 balance) {
        return balances[_owner];
    }

    function mintToken(address target, uint256 mintedAmount) public {
        balances[target] += mintedAmount;
        totalSupply += mintedAmount;
        emit Transfer(0, this, mintedAmount);
        emit Transfer(this, target, mintedAmount);
    }
}
```
